--CG_RetailVisitKpi 
--Percent_Tasks_Completed
q = load "${App.Datasets.CG_RetailVisitKpi37_tp.FullyQualifiedName}";
q = group q by ('AssessmentTask_Visit_Visitor_UniqueUserName');
result = foreach q generate 'AssessmentTask_Visit_Visitor_UniqueUserName' as 'Rep_Name', sum('Completed_Tasks_Count') / count() as 'Percent_Tasks_Completed';

--Average Share of Shelf 
