sos = foreach sos generate 'AssessmentTask_Visit_Visitor_UniqueUserName' as 'Rep_Name', 'AssessmentTask_Visit_RetailStore_Name' as 'Store_Name', avg(Compliance_Percentage) as 'avg_SoS_Compliance_Percentage';
