coalesce(Visit_result.'Visitor_UniqueUserName', CG_OrderItem.'Rep_Name',sos.'Rep_Name', result.'Rep_Name', ofs.'Rep_Name', comp_result.'Rep_Name') as 'Visitor_UniqueUserName', 
sum(CG_OrderItem.'Total_Quantity_of_Products') as 'Total_Quantity_of_Products', 
sum(CG_OrderItem.'Total_Sales') as 'Total_Sales', 
avg(sos.'avg_SoS_Compliance_Percentage') as 'avg_SoS_Compliance_Percentage', 
sum(CG_OrderItem.'Number_of_Products_Owned') as 'Total_Num_Products_Sold', 
avg(comp_result.'Avg_Compliance_Percentage_Current') as 'Avg_Compliance_Percentage',
sum(ofs.'Out_of_Stock_cases') as 'Out_of_Stock_cases',
sum(Visit_result.'Number_of_Visits') as 'Total_Num_Visits', 
avg(Visit_result.'avg_Number_of_Visits_per_Day') as 'avg_Number_of_Visits_per_Day',
sum(Visit_result.'Percent_of_Successful_visits') as 'Percent_Successful_Visits', 
sum(result.'Percent_Tasks_Completed') as 'Percent_Tasks_Completed', 
sum(CG_OrderItem.'Total_Sales')/sum(Visit_result.'Number_of_Visits') as 'avg_Order_Value_per_Visit';

