orders = foreach orders generate 'Order_AssessmentTaskOrder_AssessmentTask_Visit_Visitor_UniqueUserName' as 'Rep_Name', first('Order_AssessmentTaskOrder_AssessmentTask_Visit_Visitor_SmallPhotoUrl') as 'Rep_Pic', unique('Order_AssessmentTaskOrder_AssessmentTask_Visit_Id') as 'Productive Visits';
--CG_RetailVisitKpi 
