sum(Visit_result.'Completed Visits') as 'Completed Visits', sum(Visit_result.'Number_of_Visits') as 'Number_of_Visits', sum(rc_result.'Route_Compliance') as 'Route_Compliance', avg(sos.'avg_SoS_Compliance_Percentage') as 'avg_SoS_Compliance_Percentage', avg(inv.'Avg_InventoryCompliance_Percentage') as 'Avg_InventoryCompliance_Percentage', avg(Visit_result.'avg_Number_of_Visits_per_Day') as 'avg_Number_of_Visits_per_Day', sum(CG_OrderItem.'Total_Sales') as 'Total_Sales', sum(CG_OrderItem.'Total_Sales')/sum(Visit_result.'Number_of_Visits') as 'Avg_Order_Value_per_Visit', sum(CG_OrderItem.'Total_Quantity_of_Products') as 'Total_Quantity_of_Products', sum(CG_OrderItem.'Number_of_Products_Owned') as 'Number_of_Products_Owned', sum(orders.'Productive Visits') as 'Productive Visits', sum(result.'Percent_Tasks_Completed') as 'Percent_Tasks_Completed', sum(ofs.'Out_of_Stock_cases') as 'Out_of_Stock_cases', avg(comp_result.'Avg_Compliance_Percentage') as 'Avg_Compliance_Percentage';
final_table = filter final_table by '{{cell(static_3.selection, 0, "Remove_null_Alias").asString()}}' is not null;
